def generate_states(graph):
    nodes_tuples = []
    nodes_connection_weights = []
    available_nodes_names = ['Cancun','Valladolid','Felipe Carrillo Puerto','Campeche','Merida','Chetumal','Francisco Escarcega','Ciudad Del Carmen','Villa Hermosa','Tuxtla','Acayucan','Tehuantepec','Alvarado','Oaxaca','Tehuacan','Puerto Angel',
    'Izucar De Matamoros','Pinotepa Nacional','Acapulco','Chilpancingo','Iguala','Puebla','Cordova','Veracruz','Cuernavaca','Ciudad De México','Ciudad Altamirano','Zihuatanejo','Playa Azul','Colima','Manzanillo','Toluca De Lerdo','Pachuca De Soto','Queretaro',
    'Atlacomulco','Tuxpan De Rodriguez Cano','San Luis Potosi','Salamanca','Morelia','Tampico','Guanajuato','Guadalajara','Zacatecas','Aguascalientes','Tepic','Mazatlan','Culiacán','Topolobampo','Ciudad Obregón','Guaymas','Hermosillo','Durango','Torreón',
    'Hidalgo del Parral','Chihuahua','Janos','Agua Prieta','Juarez','Santa Ana','Mexicalli','San Felipe','Tijuana','Ensenada','San Quintin','Santa Rosalia','Santo Domingo','La Paz','Cabo San Lucas','Ciudad Victoria','Monterrey','Matamoros','Nuevo Laredo',
    'Piedras Negras','Reynosa','Soto la Marina','Monclova','Ojinaga','Tlaxcala'] 
    for matrix_row_index in range(len(graph)):
        #print('matrix row' , graph[matrix_row_index])
        connections_and_weights = []
        for matrix_column_index in range(len(graph[0])):
            if graph[matrix_row_index][matrix_column_index] != 0:
                nodes_tuples.append((available_nodes_names[matrix_row_index], available_nodes_names[matrix_column_index]))
                connections_and_weights.append((available_nodes_names[matrix_column_index],graph[matrix_row_index][matrix_column_index]))
        if len(connections_and_weights) != 0:
            nodes_connection_weights.append([available_nodes_names[matrix_row_index], connections_and_weights])
    return nodes_tuples, nodes_connection_weights

def beadth_first_search(tree,start,finish):
    nodes_visited = []
    goal_path = []
    tuples = []
    path = [start]

    while path:
        current_node = path.pop(0)

        if current_node not in nodes_visited:
            print('\nCurrent node ', current_node)
            nodes_visited.append(current_node)
        
        node_childs = [node_tuple[1] for node_tuple in tree[0] if node_tuple[0] == current_node]
        node_weights = [node_tuple[1] for node_tuple in tree[1] if node_tuple[0] == current_node]
        print('node_childs', node_childs)

        for child in node_childs:
            if child not in nodes_visited:
                path.append(child)
                tuples.append([current_node, child])

        for child_weights in node_weights[0]:
            pass

    if finish not in nodes_visited:
        print("\nEl nodo buscado no esta presente")
    else:
        goal_path.append(finish)
        while start not in goal_path:
            for node_tuple in tuples:
              if node_tuple[1] == goal_path[(len(goal_path)-1)]:
                goal_path.append(node_tuple[0])
        print("\nEl camino optimo es: ")
        print(goal_path[::-1])

def busqueda_profundidad_limitada(start, goal, tree, limit):
    if goal == start:
        return [start]
    elif limit == 0:
        return None
    for node_tuple in tree[0]:
        if node_tuple[0] == start: 
            result = busqueda_profundidad_limitada(node_tuple[1], goal, tree, limit-1)
            if result is not None:
                return [start] + result
    return None

def print_result(start, goal, limit, result):
    if result == None:
        print("\nEl camino de {} a {}, con limite {} no fue encontrado.\n".format(start, goal, limit))
    else:
        print("\nEl camino de {} a {} con limite {} es {}.\n".format(start, goal, limit, result))

def main():
    tree = generate_states(formed_graph)
    print('\ntree = ', tree[0], '\n')
    print('weights = ', tree[1], '\n')

    conf = False
    conf2 = False

    while conf == False:
        start = input('\nstart node?: ').title()
        for node_tuple in tree[0]:
            if node_tuple[0] == start:
                conf = True
                break
            elif node_tuple[1] == start:
                conf = True
                break
        if conf == False:
            print("\nEl nodo no ha sido encontrado, introduzca un nodo correcto")   

    while conf2 == False:
        goal = input('\ngoal node?: ').title()
        for node_tuple in tree[0]:
            if node_tuple[0] == goal:
                conf2 = True
                break
            elif node_tuple[1] == goal:
                conf2 = True
                break
    
        if conf2 == False:
            print("\nEl nodo no ha sido encontrado, introduzca un nodo correcto")
    

    limit = int(input('\nDepth Limit?: '))

    print_result(start, goal, limit, busqueda_profundidad_limitada(start, goal, tree, limit))

main()

